import React from 'react';

const Pokemon = props => {
    return <div>
        <img src={props.imageUrl} alt = ''>
        </img>
        <h1>{props.clubTitle}</h1>
        <ul></ul>
    </div>
}

export default Pokemon;

const Club = props => {
    return <div>
        <img src={props.imageUrl} alt= '' ></img>
        <h1>{props.pokemonTitle}</h1>
        <ul>
            {props.pokemons.map((pokemon, id) =>{
                return <li key={id}>
                    {pokemon}
                </li>
            })}
        </ul>
    </div>
}
